import React from 'react'

export const Card = ({item}) => {
  return (
    <div className='my-8'>
        <a href="https://jay035.github.io/Calculator/">
          {/* <!-- screenshot --> */}
          <img src={item.image} alt="" />
          {/* overlay */}
          <div className=""></div>
        </a>
        <div class="">
          <p class="">{item.title} </p>
          <p class="">{item.description}</p>
          
          <div class="">
            {/* <!-- link to github repo --> */}
            <a href="https://github.com/Jay035/Calculator-app">
            </a>
            {/* <!-- link to live site  --> */}
            <a href={item.demoURL}>
            </a>
          </div>
        </div>
    </div>
  )
}
